// PDF.js global configuration
pdfjsLib.GlobalWorkerOptions.workerSrc = 'pdf.worker.js';

// Canvas and text layer setup
const container = document.getElementById('pdf-container');
const canvas = document.getElementById('pdf-canvas');
const textLayer = document.createElement('div');
textLayer.className = 'textLayer';
container.appendChild(textLayer);
const ctx = canvas.getContext('2d');

let currentScale = 1;
let pdfDoc = null;
let currentPage = 1;

// Base64 PDF String (use actual base64 data in production)
const pdfBase64 = '';

// Function to convert base64 to Uint8Array for PDF.js
function base64ToUint8Array(base64) {
    const raw = atob(base64);
    const uint8Array = new Uint8Array(raw.length);
    for (let i = 0; i < raw.length; i++) {
        uint8Array[i] = raw.charCodeAt(i);
    }
    return uint8Array;
}

// Render PDF page with text layer
function renderPage(pageNum, scale = 1) {
    pdfDoc.getPage(pageNum).then(page => {
        const viewport = page.getViewport({ scale: scale });
        canvas.width = viewport.width;
        canvas.height = viewport.height;

        // Set container and text layer dimensions
        container.style.width = `${viewport.width}px`;
        container.style.height = `${viewport.height}px`;
        textLayer.style.width = `${viewport.width}px`;
        textLayer.style.height = `${viewport.height}px`;

        // Render PDF page on canvas
        const renderContext = {
            canvasContext: ctx,
            viewport: viewport
        };

        // Clear previous text layer content
        textLayer.innerHTML = '';

        // Render page and text layer
        const renderTask = page.render(renderContext);
        const textContent = page.getTextContent();

        Promise.all([renderTask.promise, textContent])
            .then(([_, textContent]) => {
                // Render text layer
                pdfjsLib.renderTextLayer({
                    textContent: textContent,
                    container: textLayer,
                    viewport: viewport,
                    textDivs: []
                });
            });
    });
}

// Load PDF and render first page
pdfjsLib.getDocument({ data: base64ToUint8Array(pdfBase64) }).promise.then(pdf => {
    pdfDoc = pdf;
    renderPage(currentPage, currentScale);
});

// Pinch-to-zoom handling
let lastTouchEnd = 0;
document.addEventListener('touchmove', event => {
    if (event.touches.length == 2) {
        const touch1 = event.touches[0];
        const touch2 = event.touches[1];
        const distance = Math.sqrt(
            Math.pow(touch1.clientX - touch2.clientX, 2) +
            Math.pow(touch1.clientY - touch2.clientY, 2)
        );

        if (lastTouchEnd !== 0) {
            const diff = distance - lastTouchEnd;
            if (diff > 0) {
                // Pinch-out (Zoom-in)
                currentScale += 0.05;
            } else {
                // Pinch-in (Zoom-out)
                currentScale -= 0.05;
                currentScale = Math.max(currentScale, 0.5);
            }
            renderPage(currentPage, currentScale);
        }

        lastTouchEnd = distance;
    }
});

document.addEventListener('touchend', () => {
    lastTouchEnd = 0;
});

// CSS styles for text layer
const style = document.createElement('style');
style.textContent = `
    .textLayer {
        position: absolute;
        left: 0;
        top: 0;
        right: 0;
        bottom: 0;
        overflow: hidden;
        opacity: 0.2;
        line-height: 1.0;
    }

    .textLayer > span {
        color: transparent;
        position: absolute;
        white-space: pre;
        cursor: text;
        transform-origin: 0% 0%;
    }

    .textLayer ::selection {
        background: rgba(0,0,255,0.3);
    }
`;
document.head.appendChild(style);